import React from "react";
import { Card } from "react-bootstrap";
import nproducts from "./nproducts";

export const Novicedetails = ({ nproducts }) => {
  return (
    <div>
      <Card className="my-3 p-3 rounded">
        <a href={`/nproduct/${nproducts.id}`}>
          <Card.Img src={nproducts.image} variant="top" />
        </a>
        <Card.Body>
          <a href={`/nproducts/${nproducts.id}`}>
            <Card.Body.Title as="div">
              <strong>{nproducts.name}</strong>
            </Card.Body.Title>
          </a>
          <Card.Text as="div">
            <div className="my-3">
              {nproducts.rating} from {nproducts.numReviews}
            </div>
          </Card.Text>
          <Card.Text as="div"> $ {nproducts.price} </Card.Text>
        </Card.Body>
      </Card>
    </div>
  );
};
